import React, {Router} from 'react'
import {Link} from "react-router-dom"
import {Consumer, withChartContext} from "./DataProvider"


function BlsLink(button) {
    return (
        <Consumer>
            {value => (<button onClick={value.getDataInfo}><Link to={{
                pathname: `/study/${button.series_id}`,
                state:{button}
            }}>{button.title}</Link></button>)}
         </Consumer>
    )
}

export default BlsLink
